import React from "react";
import { Table } from "react-bootstrap";
import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import avatar from "../../../assets/avatar.png"
import "./index.css";
import TableDropdown from "./Dropdown/TableDropdown";

const Staffs_Details = () => {
  return (
    <>
      <div className="contaniner-fluid">
        <div className="row">
          <AdminSidebar staff={true} />
          <div className="col-md-9 dashboardmainarea">
            <AdminNavbar />
            <div className="dashboard_main_area pb-0 row">
              <div className="col-md-11 expand12">
                <div className="row jcenter pt-9">
                  <div className="col-md-12 charthome">
                    <div className="row">
                      <div className="col-md-4">
                        <div className="herad1"></div>
                        <div className="staf45">
                            <img src={avatar} alt="" className="img2" />
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Staffs_Details;
